import React from "react";
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { FaUser } from "react-icons/fa";
import { MdDynamicFeed } from "react-icons/md";
import { IoLogOut } from "react-icons/io5";

const Container = styled.div`
    display: flex;
    flex-direction: column;
    position: fixed;
    left: 0;
    height: 100vh;
    margin: 15px;
    margin-top: 150px; /* Pode ajustar conforme necessário */
`;

const StyledLink = styled(Link)`
    color: #fff;
    padding: 15px;
    text-decoration: none;
    font-weight: bold; /* Ajustado para negrito */
    margin: 15px;
    font-size: 20px;
    background-color: #64b3cc;
    border-radius: 20px; 
    display: flex;
    align-items: center;
    justify-content: center;
    width: 40px; /* Ajuste conforme necessário */
    height: 40px; /* Ajuste conforme necessário */
`;

function NavBar() {
    return (
        <Container>   
            <StyledLink to="/perfil"><FaUser size={20} /></StyledLink>
            <StyledLink to="/feed"><MdDynamicFeed size={20} /></StyledLink>
            <StyledLink to="/login"><IoLogOut size={20} /></StyledLink>
        </Container>
    );
}

export default NavBar;
